#include <stdio.h>

typedef struct {
  double A;
  double T;
  double G;
  double C;
} Gene;

int get_gene_length(char gene[]);
char get_gene_hundred_ahead(char gene[]);
char get_gene_hundred_hide(char gene[]);
Gene get_percentage(char gene[]);

int main(void)
{
  char gene[] = "";

  int length = get_gene_length(gene);
  Gene g = get_percentage(gene);

  double sum = g.A / length * 100 + g.T / length * 100 + g.G / length * 100 + g.C / length * 100;

  printf("(1) Length = %d\n", get_gene_length(gene));
  printf("(2) 100(head) = %c\n", get_gene_hundred_ahead(gene));
  printf("(3) 100(hide) = %c\n", get_gene_hundred_hide(gene));
  printf("(4) A: %lf % T: %lf % G: %lf % C: %lf %\n", g.A / length * 100, g.T / length * 100, g.G / length * 100, g.C / length * 100);
  printf("sum=%lf %\n", sum);

  return 0;
}

int get_gene_length(char gene[]) {
  int length = 0;
  int i = 0;
  while (gene[i] != '\0') {
    length++;
    i++;
  }
  return length;
}

char get_gene_hundred_ahead(char gene[]) {
  return gene[99];
}

char get_gene_hundred_hide(char gene[]) {
  return gene[get_gene_length(gene) - 100];
}

Gene get_percentage(char gene[]) {
  Gene gene_data = {0, 0, 0, 0};
  int i = 0;
  while (gene[i] != '\0') {
    switch (gene[i]) {
      case 'A':
        gene_data.A++;
        break;

      case 'T':
        gene_data.T++;
        break;

      case 'G':
        gene_data.G++;
        break;

      case 'C':
        gene_data.C++;
        break;
    }
    i++;
  }
  return gene_data;
}
